function() {
  GTM_UTILS = window.GTM_UTILS || {};
  if (!GTM_UTILS.setCookie) {
    GTM_UTILS.setCookie = function(cname, cvalue, exmin, domain, path) {
      // Default value for path
      var path = path || "/";
      var hostname = window.location.hostname;

      // Default value for domain
      try {
        var regex = /([\w\d]+\.[\w]+)$/gm;
        var match = regex.exec(hostname)[1];
        var domain = domain || '.' + match;
      } catch (e) {
        domain = hostname;
      }

      // Default value for exmin/expiresmax
      if (exmin) {
        var d = new Date();
        d.setTime(d.getTime() + (exmin * 60 * 1000));
      } else {
        var d = new Date('2031-01-01');
      }
      var expires = "expires=" + d.toUTCString();

      document.cookie = cname + "=" + cvalue + "; path=" + path + "; " + "domain=" + domain + "; " + expires;
    }
  }

  if (!GTM_UTILS.getCookie) {
    GTM_UTILS.getCookie = function(cname) {
      var name = cname + "=";
      var ca = document.cookie.split(';');
      for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') {
          c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
          return c.substring(name.length, c.length);
        }
      }
      return "";
    }
  }

  if (!GTM_UTILS.getParameterByName) {
    GTM_UTILS.getParameterByName = function(name, url) {
      if (!url) url = window.location.href;
      name = name.replace(/[\[\]]/g, "\\$&");
      var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
      if (!results) return null;
      if (!results[2]) return '';
      return decodeURIComponent(results[2].replace(/\+/g, " "));
    }
  }

  if (!GTM_UTILS.updateQueryStringParameter) {
    GTM_UTILS.updateQueryStringParameter = function(uri, key, value) {
      // remove the hash part before operating on the uri
      var i = uri.indexOf('#');
      var hash = i === -1 ? '' : uri.substr(i);
      uri = i === -1 ? uri : uri.substr(0, i);

      var re = new RegExp("([?&])" + key + "=.*?(&|$)", "i");
      var separator = uri.indexOf('?') !== -1 ? "&" : "?";
      if (uri.match(re)) {
        uri = uri.replace(re, '$1' + key + "=" + value + '$2');
      } else {
        uri = uri + separator + key + "=" + value;
      }
      return uri + hash; // finally append the hash as well
    }
  }

