function() {
  var lsKey = "_adMind_acc";

  var accountStatus = {{DL - ecommerce.checkout.actionField.option}};
  if(!accountStatus) return "No";

  var returnedAccount = "No";

  switch(accountStatus) {
    case "Existing User":
      returnedAccount = "Yes";
      break;
    case "New User":
      returnedAccount = "Yes";
      break;
    case "Guest":
      returnedAccount = "No";
      break;
    default:
      returnedAccount = "No";
      break;
  }

  var lsVal = window.localStorage.getItem(lsKey);

 if(!lsVal) {
    window.localStorage.setItem(lsKey, returnedAccount);
 } else {

   //Update local storage only if storage is no and new value is yes
   if(lsVal == "No" && returnedAccount == "Yes") {
     window.localStorage.setItem(lsKey, returnedAccount);
     lsVal = returnedAccount;
   }

   returnedAccount = (lsVal == "Yes" || lsVal == "No") ? lsVal : "No"; 
 }

  return returnedAccount;
}

